import React from 'react';
import DashboardBody from "./DashboardBody";
import { Tab } from 'semantic-ui-react';
import './Main.css';
import Loader from "./reusableComponents/Loader";

class Main extends React.Component {

    render() {
        const panes = [
            { menuItem: 'Swift1.1', render: () => <Tab.Pane attached={false}><DashboardBody/></Tab.Pane> },
            { menuItem: 'SunbirdSMSG', render: () => <Tab.Pane attached={false}><DashboardBody/></Tab.Pane> },
            { menuItem: 'Swan', render: () => <Tab.Pane attached={false}><Loader/></Tab.Pane> },
        ]
        return (
            <div className="Tabs">
                <Tab grid={{paneWidth: 12, tabWidth: 1}}  menu={{ fluid: true, vertical: true, tabular: 'right' }} panes={panes} />
            </div>
        );
    }
}

export default Main;
